import './App.css';
import Home from './components/Home';
import AddUser from './components/AddUser';
import AllUsers from './components/AllUsers';
import NavBar from './components/NavBar';

import { BrowserRouter } from 'react-router-dom';


function App() {
  return (
    <BrowserRouter>
      <NavBar/>
      <Home/>
      <AllUsers/>
      <AddUser/>
      </BrowserRouter>
  )
}
export default App;
